import React, { useState } from 'react';
import axios from 'axios';

interface UploadResponse {
  result: string;
}

const FileUpload: React.FC<{ endpoint: string; label: string }> = ({ endpoint, label }) => {
  const [file, setFile] = useState<File | null>(null);
  const [responseMessage, setResponseMessage] = useState<string>('');

  const handleFileChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    if (e.target.files && e.target.files.length > 0) {
      setFile(e.target.files[0]);
    }
  };

  const handleUpload = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    if (!file) return;
    const formData = new FormData();
    formData.append('file', file);
    try {
      const response = await axios.post<UploadResponse>(`http://localhost:8000/${endpoint}`, formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
      });
      setResponseMessage(response.data.result);
    } catch (error: any) {
      console.error('Error uploading file:', error.response ? error.response.data : error);
      setResponseMessage('Error processing the file.');
    }
  };

  return (
    <div style={{ margin: '20px' }}>
      <h3>{label}</h3>
      <form onSubmit={handleUpload}>
        <input type="file" onChange={handleFileChange} />
        <button type="submit" style={{ marginLeft: '8px' }}>Upload</button>
      </form>
      {responseMessage && <p>Response: {responseMessage}</p>}
    </div>
  );
};

export default FileUpload;
